import React from "react";
import { Footer, FooterTab, Button, Text } from "native-base";
import { Link } from "react-router-native";

export const AppFooter = ({ match }) => (
  <Footer>
    <FooterTab>
      <Button active>
        <Text>All Cities</Text>
      </Button>
      <Button>
        <Text>My City</Text>
      </Button>
      <Link to={`${match.url}/starScreen`} underlayColor="#f0f4f7">
        <Text>Star</Text>
      </Link>
    </FooterTab>
  </Footer>
);
